import "./App.css";
import Education from "./Education";
import Experience from "./Experience";
import Header from "./Header";
import JumpClicker from "./JumpClicker";
import Projects from "./Projects";

function App() {
  return (
    <div className="App">
      <Header />
      <JumpClicker />
      <Projects />
      <div style={{ display: "flex" }}>
        {" "}
        <Education />
        <br />
        <Experience />
      </div>
    </div>
  );
}

export default App;
